import React, { Component } from 'react';
import Calender from './components/dashboard/Calender';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
		<Calender start="1" end="30" year="2018" month="3" />
      </div>
    );
  }
}

export default App;
